create table INGREDIENT_COUNT
(
    INGREDIENT_COUNT NUMBER not null,
    INGREDIENT_ID    NUMBER not null
        constraint INGREDIENT_COUNT_FK1
            references INGREDIENT,
    RESTAURANT_ID    NUMBER not null
        constraint INGREDIENT_COUNT_FK2
            references RESTAURANT,
    constraint INGREDIENT_COUNT_PK
        primary key (INGREDIENT_ID, RESTAURANT_ID)
)
/

